import React from "react"
import { NavLink } from "react-router-dom" 

function NavBar() {

    return (
        <nav>
            <Link to="/">Home</Link>
            <Link to="/Books">Books</Link>
            <Link to="*">Error page</Link>
        </nav>
    );
}

export default NavBar;
